import React from 'react';
import { useNavigate } from 'react-router-dom';
import { authService } from '../utils/authService';

function Logout() {
  const navigate = useNavigate();

  const handleLogout = () => {
    authService.logout();
    navigate('/login');
  };

  return (
    <div className="flex items-center justify-center min-h-screen bg -gradient-to-br from-primary-50 to-primary-100">
      <div className="bg-white shadow-2xl rounded-2xl max-w-md w-full p-8 text-center">
        <h2 className="text-2xl font-bold text-primary-700">Logout</h2>
        <p className="text-gray-500 mt-2">Are you sure you want to logout?</p>
        <button 
          onClick={handleLogout} 
          className="mt-4 w-full bg-primary-700 text-white py-2 rounded-lg hover:bg-primary-600 transition duration-300"
        >
          Yes, Logout
        </button>
      </div>
    </div>
  );
}

export default Logout;
